const AddNewProperty2 = ({ onScroll }) => {

    return (
        <div className="px-4 md:px-8 lg:px-10 py-4">

            <h1 className="pt-4 pb-8 2xl:pb-12 text-2xl 2xl:text-3xl font-bold text-color5">Add New Property</h1>
            <div className="grid">
                <div className="flex 2xl:space-x-24 border">
                    <h2 className="my-auto uppercase text-xl font-semibold text-color5">For Sale</h2>
                    <img className="2xl:w-max" src="AddNewProperty/Group 9494.svg"/>
                </div>
            </div>






        </div>
    )
}

export default AddNewProperty2;
